    })
    const listItems = this.props.mintHistory.map((prop) => {
      let time = new Date(prop.time * 1000)
      const tokenUrl = "http://localhost:3000/token?address="
      return (
        <div>
          <p>Time stamp: {time.toUTCString()}</p>
          <p>Address:  <a href = {tokenUrl.concat(prop.tokenAddress)}></a>{prop.tokenAddress}</p>
        </div>
    )});
    return (
      <div>
        <h1>
          Ledger
        </h1>
        {listItems}
      </div>
    );
  }
}

export default MintLedger;
